import { useEffect, useState } from "react";
import Navbar from "../components/Navbar";

const ConvertedFiles = () => {

    const [conversionData, setConversionData] = useState()

    useEffect(() => {
        console.log(localStorage.getItem('userid'))
        fetch(`http://localhost:1337/api/getconversiondata/${localStorage.getItem('userid')}`)
            .then((response) => {
                const reader = response.body.getReader();
                console.log(reader)
                reader.read().then(({ done, value }) => {
                    if (done) {
                        console.log('end...')
                        return;
                    }
                    const decoder = new TextDecoder();
                    const strData = decoder.decode(value)
                    const jsonData = JSON.parse(strData)
                    console.log(jsonData)
                    setConversionData(jsonData)
                });
            })
        console.log(conversionData)
    }, [])

    return (
        <div>
            <Navbar />
            <div>
                <table>
                    <tr>
                        <th>Conversion Name</th>
                        <th>Mapping Name</th>
                        <th>CSV File</th>
                        <th>Json File</th>
                    </tr>
                    {
                        conversionData?.map((item) => {
                            console.log(item.jsonfile);
                            <div>
                                item.jsonfiles
                            <tr>
                                {/* <td>{item.conversionname}</td>
                                <td>{item.mappingname}</td>
                                <td>{item.csvfile}</td>
                                <td>{item.jsonfile}</td> */}
                            </tr>
                            </div>
                        })
                    }
                </table>
            </div>
        </div>
    );
}

export default ConvertedFiles;
